fn insert_frames(
        &mut self,
        page_size: c_int,
        page_headers: &mut super::PageHeaders,
        size_after: u32,
        is_commit: bool,
        sync_flags: c_int,
    ) -> super::Result<usize> {
        unsafe {
            (*self.wrapper).insert_frames(
                &mut *self.wrapped,
                page_size,
                page_headers,
                size_after,
                is_commit,
                sync_flags,
            )
        }
    }
